import React, { useState, useEffect } from "react";
import axios from "axios";
import "../assets/table3.css";

const Table3 = ({ apiData2 }) => {
  const [data, setApiData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          process.env.REACT_APP_HOST + "/api/ping/check-cctv2"
        );
        setApiData(response.data);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []);

  const renderTable = (phaseData, phaseNumber) => {
    if (!phaseData || !phaseData.data) {
      return null;
    }

    return (
      <div key={`table-phase-${phaseNumber}`}>
        <h2>Phase {phaseNumber}</h2>
        <table>
          <thead>
            <tr>
              <th>IP</th>
              <th>Name</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {phaseData.data.map((item) => (
              <tr key={item.ip}>
                <td>{item.ip}</td>
                <td>{item.name}</td>
                <td>{item.status}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  return (
    <div>
      {data &&
        <>
          {renderTable(data.phase1, 1)}
          {renderTable(data.phase2, 2)}
          {renderTable(data.phase3, 3)}
        </>
      }
    </div>
  );
};

export default Table3;
